import React from 'react';
import ReferenceRequest from './components/ReferenceRequest';
import TextField from '@material-ui/core/TextField';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Welcome to the Credit Clerk!
        </p>
        <ReferenceRequest />
        <TextField
          id="standard-name"
          label="Name"
          margin="normal"
          className="App-form"
        />


      </header>
    </div>
  );
}

export default App;
